<h2 class="MB30">日本製にこだわる靴下製造メーカーのショップ「なえしょっぷ」</h2>
<div class="clearfix MB20">
<p class="LeftPhoto MR20"><img src="http://www.rakuten.ne.jp/gold/naeshop/img/naeshop_01.png" /></p>
<p class="MT20 MB30"><img src="http://www.rakuten.ne.jp/gold/naeshop/img/naeshop_02.png" /></p>
<p>「なえしょっぷ」は、兵庫県から認可を得た医療用靴下を製造する工場直売のショップです。昭和51年より紡績の町「兵庫県 加古川」で、職人の手により赤ちゃんからお年寄りまで全ての年代の方の足を快適に包み込む靴下を作り続けてきました。</p>
<br />
<p>熟練の技で様々なブランドやショップからのご信頼いただき、製造の発注を多くいただいています。また、全国各地の衣料量販店へもオリジナル商品を卸しています。</p>
</div>
